import React from 'react'
import { useState } from 'react';
import { useEffect } from 'react';


export default function ShowAppointment() {

    const [Patients, setPatients] = useState([]);
    const [Appointments, setAppointments] = useState({
      appointId : '',
      appointDate: '',
      patientId: '',
      doctorId: '',
      paymentId: '',
      prescriptionTitle: '',
      prescriptionDetails: '',
      status : false
}
);

  
   const  docotor_id = JSON.parse(localStorage.getItem('docotor_id'))

    useEffect(() => {

        fetch('/Appointment/showAppointment/1')
            .then((response) => {
                setAppointments(response)
                response.json()
            })
            .then((data)=> console.log(data))
            .catch((error) => {
                console.log(error);
            })
            

            
    }, []);

  return (
    <div>

    <p>Appointments -</p>
    {docotor_id}


    </div>
  )
}
